      out.write("\t\t\t\t\t\t\t/* if (roadAddr !== '') {\r\n");
      out.write("\t\t\t\t\t\t\t\tdocument.getElementById(\"sample4_extraAddress\").value = extraRoadAddr;\r\n");
      out.write("\t\t\t\t\t\t\t} else {\r\n");
